import React from 'react';
import './App.css';
import { Input, Button } from 'antd';



function ScreenHome() {
  const [signupName, setsignupName] = useState('');
  const [signupEmail, setsignupEmail] = useState('');
  const [signupPassword, setsignupPassword] = useState('');
  return (
    <div className="Login-page" >

          {/* SIGN-IN */}

          <div className="Sign">

            <Input className="Login-input" placeholder="arthur@lacapsule.com" />

            <Input.Password className="Login-input" placeholder="password" />


            <Button href="" style={{width:'80px'}} type="primary">Sign-in</Button>

          </div>

          {/* SIGN-UP */}

          <div className="Sign">

            <Input id="signupName" className="Login-input" placeholder="Arthur G" />
            <Input id="signupEmail" className="Login-input" placeholder="arthur@lacapsule.com" />

            <Input.Password id="signupPassword" className="Login-input" placeholder="password" />


            <Button href="" style={{width:'80px'}} type="primary">Sign-up</Button>

          </div>

      </div>
  );
}

export default ScreenHome;
